import React from "react";
import Post from "./Post/Post";

const Posts = ({posts}) => {
    return (
        <div>
            {
                posts.map(
                    post => {
                        return <Post post={post}/>
                    } 
                )
            }
        </div>
    )
}

export default Posts;
